// Auto-generated tiny WAV (0.25s, 440Hz) as base64 for offline "synthesis"
export const BEEP_WAV_BASE64 = "";
export function beepBlob(): Blob {
  const byteChars = atob(BEEP_WAV_BASE64);
  const bytes = new Uint8Array(byteChars.length);
  for (let i = 0; i < byteChars.length; i++) bytes[i] = byteChars.charCodeAt(i);
  return new Blob([bytes], { type: "audio/wav" });
}